import React, { Component } from 'react';
import './App.css';
import Home from './Home';
import { Route } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div>
        <Route exact path={`/home`} render={ (routerProps) => < Home routerProps={routerProps} />} />
      </div>
    );
  }
}

export default App;
